import React from 'react';

function Footer() {
  return (
    <footer className="bg-blue-900 text-white py-12 mt-auto border-t border-blue-800 shadow-lg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 flex flex-col md:flex-row justify-between items-center">
        <div className="text-sm">&copy; {new Date().getFullYear()} SAHYatri Government Portal. All rights reserved.</div>
        <div className="flex space-x-6 mt-4 md:mt-0">
          <a href="#" className="hover:underline">
            Privacy Policy
          </a>
          <a href="#" className="hover:underline">
            Terms of Service
          </a>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
